import styled from 'styled-components'
import React from 'react'

const ProgressHolder = styled.div`
    padding: 0px;
    height: 30px;
`
const Progress = styled.div`
    margin: 0px;
    background-color: black;
    height: 100%;
    width: 60%;
`

export default function ProgressBar (props) {
    return <ProgressHolder>
        <Progress/>
    </ProgressHolder>
}
